function getBLMScriptParams(a){var b=document.getElementsByTagName("script");for(var i=0;i<b.length;i++){if(b[i].src.indexOf("/"+a)>-1){var c=b[i].src.split("?").pop().split("&");var p={};for(var j=0;j<c.length;j++){var d=c[j].split("=");p[d[0]]=d[1]}return p}}return{}}


const BLMBANNER = () => {
  const params = getBLMScriptParams('blm.js')
  const position = params.position || 'fixed'
  const bgColor = params.bgColor || '#000'
  const textColor = params.textColor || '#FFF'
  const customMsg = decodeURI(params.msg) || 'We Stand In Solidarity With the Protestors.'

  var css = document.createElement('style');
  css.type = 'text/css';
  var styles = `
  header {
  		position: ${position};
  		width: 100%;
  		text-align: center;
  		font-size: 20px;
  		line-height: 50px;
  		background: ${bgColor};
  		color: ${textColor};
  		font-family: 'PT Sans', sans-serif;
  		-webkit-transition: all 0.4s ease;
  		transition: all 0.4s ease;
      top: 0;
      left: 0;
  }
  header > div {
    padding-top: 6px;
  }

  header > div > img {
    padding: 0 10px 0 0;
    margin: 0px;
    height: 50px;
  }

  header > div > h1, header > div > p {
    text-align: center;
    padding: 0px;
    margin: 0px;
    display: inline-block;
    vertical-align: top;
  }

  header > div > p > a {
    color: ${textColor};
  }
  `
  if (css.styleSheet) css.styleSheet.cssText = styles;
  else css.appendChild(document.createTextNode(styles));
  document.getElementsByTagName("head")[0].appendChild(css);



  const banner = document.createElement("header");
  banner.className = "sticky";
  banner.innerHTML = `
  <div>
  <img src="data:image/png;base64," />
  <h1>${customMsg}</h1>
  <p>#BlackLivesMatter - <a target='_blank' rel="nofollow noopener" href='https://blacklivesmatters.carrd.co/'>Learn More</a></p>
  </div>
  `;

  document.body.insertBefore(banner, document.body.childNodes[0]);
}

BLMBANNER()
